import React from 'react'
import ReactApexChart from 'react-apexcharts'

const AreaChartCard = ({Data}) => {
    const graphData ={
        series : [
            {
                name: "CHARTY",
                data:Data
            }
        ],
        options:{
            chart:{
                type:'area',
                height:'350',
                zoom:{
                    enabled:false
                }
            },
            datalabels:{
                enabled:false
            },
            stroke:{
                curve:'staright'
            },
            title:{
                text : 'CoronaTracker',
                align : 'left'
            },
            subtitle:{
                text:'NewTrack',
                align: 'left'
            },
            labels: Data,
            xaxis:{
                type : 'datetime'
            },
            yaxis:{
                opposite:true
            },
            legend : {
                horizontalAlign : 'left'
            }
        }
    }
    return (
       <div>

       </div>
    )
}

export default AreaChartCard
